var images = {
  '#image' : 'data:image/png;base64,',
  '#image-1' : 'data:image/png;base64,',
  '#image-2' : 'data:image/png;base64,',
  '#prevBtn' : 'data:image/png;base64,',
  '#nextBtn' : 'data:image/png;base64,',
  'plectrum-red' : 'data:image/png;base64,'
}

// forEach IE polyfill
if (window.NodeList && !NodeList.prototype.forEach) {
    NodeList.prototype.forEach = function (callback, thisArg) {
        thisArg = thisArg || window;
        for (var i = 0; i < this.length; i++) {
            callback.call(thisArg, this[i], i, this);
        }
    };
}

['#image', '#image-1', '#image-2'].forEach(function(c) {
  document.querySelector(c).setAttribute('src', images[c]);
});

['#prevBtn', '#nextBtn'].forEach(function(button) {
  document.querySelector(button).style.backgroundImage = 'url("'+images[button]+'")';
});

// Set up plectrum images
var plectrum;
var ul_items = document.querySelectorAll('ul > li');

function set_plectrum_li() {
  [].slice.call(ul_items).forEach(function(ul_item) {
    ul_item.style.background = 'url("' + images['plectrum-red'] + '") no-repeat';
  });
}

set_plectrum_li();

// Wait for all images to load then hide loading
var loading = document.querySelector('.page-loading-overlay');

imagesLoaded(document.querySelector('#img-div'), function() {
  document.body.style.overflowY = 'initial';
  loading.style.display = 'none';
});